import ReactDOM from 'react-dom';



class App extends React.Component {

    constructor(props){
        super();
    }



    render() {
        window.navigator.geolocation.getCurrentPosition(
            (position) => console.log(position),
            (err) => console.log(err)
        );
        return(
            <div>Latitude : </div>
        );
    }
}

ReactDOM.render(<App />, document.querySelector('#root'));
